    return(
        <>
        <div>
            <Navbar title="CREATE COURSE"/>
            <NavAssess/>
            
        </div>
        <div className="courseName">
            <label for="fname">First name:</label>
            <input type="text" id="fname" placeholder="course name"/>
            
        </div>
        
        </>
    )
}


